import React from 'react'
import '../../../public/assets/journal-logo.svg';

export const Header = () => {
  return (
    <header className="header">
      <div className="header__container">
        <picture>
          <img src="" alt="Logo Journal" />
        </picture>
      </div>
    </header>
  )
}
